import React from 'react';

function Lists() {
	return (
		<ul className="list-group">
			<li className="list-group-item">
				<input type="checkbox" id="java" />
				<label for="java">java</label>{' '}
			</li>
			<li className="list-group-item">
				<input type="checkbox" id="html" />
				<label for="html"> html </label>
			</li>
		</ul>
	);
}

export default Lists;
